es":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 26.57 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 1762 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 84.23 s &lt;/li&gt;\n&lt;li&gt; transfer time: 16.70 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.148.103.151:43741 &lt;/li&gt;\n          &lt;li&gt; Workers: 24 &lt;/li&gt;\n          &lt;li&gt; Threads: 24 &lt;/li&gt;\n          &lt;li&gt; Memory: 476.88 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2022.9.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2022.9.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n#!/usr/bin/env python\n# coding: utf-8\n\n# Import Pandas and NumPy\nprint('in')\nimport pandas as pd\nimport numpy as np\n\n\n# Dask imports\nfrom dask import dataframe as dd\nfrom dask_jobqueue import SLURMCluster\nfrom dask.distributed import Client, performance_report\n\n# Other imports\nimport matplotlib.pyplot as plt\nfrom matplotlib.pyplot import imshow\nimport warnings\nwarnings.filterwarnings(\"ignore\")\nimport time\nimport sys\n\n# if __name__ == '__main__':\nstart = time.time()\ncluster = SLURMCluster(cores=12,\n                       processes=12,\n                       job_cpu=36,\n                       name='plotgen',\n                       memory='256GB',\n                       queue='standard',\n                       header_skip=['--mem'],\n                       job_extra=['--qos=\"standard\"','--exclusive'],\n                       python='time srun python',\n                       account='m22oc-staff',\n                       walltime=\"00:10:00\",\n                       shebang=\"#!/bin/bash --login\",\n                       local_directory='$PWD',\n                       interface='ib0',\n                       log_directory='sched_logs',\n                       env_extra=['source /mnt/lustre/indy2lfs/work/m22oc/m22oc/dmckayk/.bashrc_node','conda activate'])\ncluster.scale(jobs=2)\nprint('Cluster initiated')\nclient = Client(cluster)\nprint('Client initiated')\nstop = time.time()\nprint(\"Dask setup time \",stop - start,\"seconds\")\nfrom dask.distributed import get_client\n\nprint(client.scheduler_info())\nprint(client)\n# a list of the columns we are interested in - we'll look at the air temperature and the soil temperature closest to the surface\ncols = ['DATE_TIME','SITE_ID','TA','TDT1_TSOIL','TDT2_TSOIL'] # list of columns we're interested in\ndtypes = {'DATE_TIME':object,'SITE_ID':str,'TA':np.float64,'TDT1_TSOIL':np.float64,'TDT2_TSOIL':np.float64} # datatypes dictionary\nprint(cols,dtypes)\nwith performance_report(filename='cluster.html'):\n    start = time.time()\n    ##\n    df = dd.read_csv('/work/m22oc/m22oc/shared/DAwHPC/practicals_data/P3/*2019.csv', usecols=cols, dtype=dtypes, parse_dates=['DATE_TIME'])\n    start = time.time()\n    df = df.replace(-9999,np.nan).set_index('DATE_TIME',npartitions=72)\n\n\n    df['SOIL_TEMP'] = df[['TDT1_TSOIL','TDT2_TSOIL']].mean(axis=1)\n    df = df.drop(columns=['TDT1_TSOIL','TDT2_TSOIL']).compute()\n\n    df = df[:].resample('1d').mean()\n    stop = time.time()\n    print('read csv',stop-start)\n    start = time.time()\n    #print(df.head())\n    ax = df.plot()\n    #futures = client.map(gen_plot,cols,dtypes,divisions)\n    #ax = client.gather(futures)\n    stop = time.time()\n    print(\"Plot generation took \",stop - start,\" seconds.\")\nplt.savefig('test.png')\n\n        &lt;/pre&gt;\n        "},"id":"1
